import{_ as e,c as t,o as n,ag as s}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"ALTER DOMAIN","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/ALTER_DOMAIN.md","filePath":"docs/7x/ref_guide/sql_commands/ALTER_DOMAIN.md"}'),o={name:"docs/7x/ref_guide/sql_commands/ALTER_DOMAIN.md"};function i(d,a,c,l,r,p){return n(),t("div",null,a[0]||(a[0]=[s(`<h1 id="alter-domain" tabindex="-1">ALTER DOMAIN <a class="header-anchor" href="#alter-domain" aria-label="Permalink to &quot;ALTER DOMAIN&quot;">​</a></h1><p>Changes the definition of a domain.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER DOMAIN &lt;name&gt; { SET DEFAULT &lt;expression&gt; | DROP DEFAULT }</span></span>
<span class="line"><span></span></span>
<span class="line"><span>ALTER DOMAIN &lt;name&gt; { SET | DROP } NOT NULL</span></span>
<span class="line"><span></span></span>
<span class="line"><span>ALTER DOMAIN &lt;name&gt; ADD &lt;domain_constraint&gt; [ NOT VALID ]</span></span>
<span class="line"><span></span></span>
<span class="line"><span>ALTER DOMAIN &lt;name&gt; DROP CONSTRAINT [ IF EXISTS ] &lt;constraint_name&gt; [RESTRICT | CASCADE]</span></span>
<span class="line"><span></span></span>
<span class="line"><span>ALTER DOMAIN &lt;name&gt; RENAME CONSTRAINT &lt;constraint_name&gt; TO &lt;new_constraint_name&gt;</span></span>
<span class="line"><span></span></span>
<span class="line"><span>ALTER DOMAIN &lt;name&gt; VALIDATE CONSTRAINT &lt;constraint_name&gt;</span></span>
<span class="line"><span>  </span></span>
<span class="line"><span>ALTER DOMAIN &lt;name&gt; OWNER TO { &lt;new_owner&gt; | CURRENT_USER | SESSION_USER }</span></span>
<span class="line"><span>  </span></span>
<span class="line"><span>ALTER DOMAIN &lt;name&gt; RENAME TO &lt;new_name&gt;</span></span>
<span class="line"><span></span></span>
<span class="line"><span>ALTER DOMAIN &lt;name&gt; SET SCHEMA &lt;new_schema&gt;</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>ALTER DOMAIN</code> changes the definition of an existing domain. There are several sub-forms:</p><ul><li><strong>SET/DROP DEFAULT</strong> — These forms set or remove the default value for a domain. Note that defaults only apply to subsequent <code>INSERT</code> commands. They do not affect rows already in a table using the domain.</li><li><strong>SET/DROP NOT NULL</strong> — These forms change whether a domain is marked to allow NULL values or to reject NULL values. You may only <code>SET NOT NULL</code> when the columns using the domain contain no null values.</li><li><strong>ADD domain_constraint [ NOT VALID ]</strong> — This form adds a new constraint to a domain using the same syntax as <a href="./CREATE_DOMAIN.html">CREATE DOMAIN</a>. When a new constraint is added to a domain, all columns using that domain will be checked against the newly-added constraint. These checks can be suppressed by adding the new constraint using the <code>NOT VALID</code> option; the constraint can later be made valid using <code>ALTER DOMAIN ... VALIDATE CONSTRAINT</code>. Newly inserted or updated rows are always checked against all constraints, even those marked <code>NOT VALID</code>. <code>NOT VALID</code> is only accepted for <code>CHECK</code> constraints.</li><li><strong>DROP CONSTRAINT [ IF EXISTS ]</strong> — This form drops constraints on a domain. If <code>IF EXISTS</code> is specified and the constraint does not exist, no error is thrown. In this case a notice is issued instead.</li><li><strong>RENAME CONSTRAINT</strong> — This form changes the name of a constraint on a domain.</li><li><strong>VALIDATE CONSTRAINT</strong> — This form validates a constraint previously added as <code>NOT VALID</code>, that is, it verifies that all values in table columns of the domain satisfy the specified constraint.</li><li><strong>OWNER</strong> — This form changes the owner of the domain to the specified user.</li><li><strong>RENAME</strong> — This form changes the name of the domain.</li><li><strong>SET SCHEMA</strong> — This form changes the schema of the domain. Any constraints associated with the domain are moved into the new schema as well.</li></ul><p>You must own the domain to use <code>ALTER DOMAIN</code>. To change the schema of a domain, you must also have <code>CREATE</code> privilege on the new schema. To alter the owner, you must also be a direct or indirect member of the new owning role, and that role must have <code>CREATE</code> privilege on the domain&#39;s schema. (These restrictions enforce that altering the owner does not do anything you could not do by dropping and recreating the domain. However, a superuser can alter ownership of any domain anyway.)</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>name : The name (optionally schema-qualified) of an existing domain to alter.</p><p>domain_constraint : New domain constraint for the domain.</p><p>constraint_name : Name of an existing constraint to drop or rename.</p><p>NOT VALID : Do not verify existing column data for constraint validity.</p><p>CASCADE : Automatically drop objects that depend on the constraint, and in turn all objects that depend on those objects.</p><p>RESTRICT : Refuse to drop the constraint if there are any dependent objects. This is the default behavior.</p><p>new_name : The new name for the domain.</p><p>new_constraint_name : The new name for the constraint.</p><p>new_owner : The user name of the new owner of the domain.</p><p>new_schema : The new schema for the domain.</p><h2 id="notes" tabindex="-1"><a id="section4a"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;section4a&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p>Although <code>ALTER DOMAIN ADD CONSTRAINT</code> attempts to verify that existing stored data satisfies the new constraint, this check is not bulletproof, because the command cannot “see” table rows that are newly inserted or updated and not yet committed. If there is a hazard that concurrent operations might insert bad data, the way to proceed is to add the constraint using the <code>NOT VALID</code> option, commit that command, wait until all transactions started before that commit have finished, and then issue <code>ALTER DOMAIN VALIDATE CONSTRAINT</code> to search for data violating the constraint. This method is reliable because once the constraint is committed, all new transactions are guaranteed to enforce it against new values of the domain type.</p><p>Currently, <code>ALTER DOMAIN ADD CONSTRAINT</code>, <code>ALTER DOMAIN VALIDATE CONSTRAINT</code>, and <code>ALTER DOMAIN SET NOT NULL</code> will fail if the named domain or any derived domain is used within a container-type column (a composite, array, or range column) in any table in the database. They should eventually be improved to be able to verify the new constraint for such nested values.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>To add a <code>NOT NULL</code> constraint to a domain:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER DOMAIN zipcode SET NOT NULL;</span></span></code></pre></div><p>To remove a <code>NOT NULL</code> constraint from a domain:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER DOMAIN zipcode DROP NOT NULL;</span></span></code></pre></div><p>To add a check constraint to a domain:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER DOMAIN zipcode ADD CONSTRAINT zipchk CHECK (char_length(VALUE) = 5);</span></span></code></pre></div><p>To remove a check constraint from a domain:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER DOMAIN zipcode DROP CONSTRAINT zipchk;</span></span></code></pre></div><p>To rename a check constraint on a domain:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER DOMAIN zipcode RENAME CONSTRAINT zipchk TO zip_check;</span></span></code></pre></div><p>To move the domain into a different schema:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER DOMAIN zipcode SET SCHEMA customers;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p><code>ALTER DOMAIN</code> conforms to the SQL standard, except for the <code>OWNER</code>, <code>RENAME</code>, <code>SET SCHEMA</code>, and <code>VALIDATE CONSTRAINT</code> variants, which are WarehousePG extensions. The <code>NOT VALID</code> clause of the <code>ADD CONSTRAINT</code> variant is also a WarehousePG extension.</p><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./CREATE_DOMAIN.html">CREATE DOMAIN</a>, <a href="./DROP_DOMAIN.html">DROP DOMAIN</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,40)]))}const T=e(o,[["render",i]]);export{m as __pageData,T as default};
